import logo from './logo.svg';
import Aulas from './components/Aulas';
import Instrumentos from './components/Instrumentos';
import Planos from './components/Planos';
import Sobre from './components/Sobre';
import Contato from './components/Contato';
import { useState } from 'react';
import './App.css';

function App() {
  const [showAulas, setShowAulas] =  useState(false)
  return (
    <div>
    <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p className="App">
          Studio DaCapo
        </p>
    </header>
    <button className = "btm"> Sobre </button>
      <Sobre />
    <button className = "btm" > Contato </button>
    <Contato />
    <button className = "btm" > Planos </button>
      <Planos /> 
    <Aulas onAulas= {() => setShowAulas(!showAulas)}/>
      {showAulas && <Instrumentos /> }
    </div>
  );
}

export default App;
